import React from "react";

export const InfoDetails = () => {
  return <div>InfoDetails</div>;
};

export const InfoProducer = ({ devicesInfo }) => {
  return <div className="devices-list">{devicesInfo.producer}</div>;
};

export const InfoYear = ({ devicesInfo }) => {
  return <div className="devices-list">{devicesInfo.releaseYear}</div>;
};
export const InfoInch = ({ devicesInfo }) => {
  return <div className="devices-list">{devicesInfo.inch}</div>;
};

export default InfoDetails;
